import React, { JSXElementConstructor } from 'react';
import { Wrapper, Container, Main } from './styles';
import Header from '../../components/Header';
import { View } from 'react-native';

interface Item {
  key: string;
  render: () => JSX.Element;
  isTitle?: boolean;
}

const Following: React.FC = () => {
  React.useMemo(() =>{
    const items: Item[] = [
      {
        key: 'PAGE_HEADING',
        render: () => <View/>
      },
      {
        key: 'FOLLOWED_CATEGORIES',
        render: () => <View/>,
        isTitle: true,
      },
      { key: 'C1', render: () => <View/> },
      {
        key: 'FOLLOWED_CATEGORIES',
        render: () => <View/>,
        isTitle: true,
      },
      { key: 'C1', render: () => <View/> },
      {
        key: 'FOLLOWED_CATEGORIES',
