        isTitle: true,
      },
      { key: 'C1', render: () => <View/> },
      {
        key: 'FOLLOWED_CATEGORIES',
        render: () => <View/>,
        isTitle: true,
      },
      { key: 'C1', render: () => <View/> },
    ]
  }, []);
  return (
    <Wrapper>
      <Container>
        <Header></Header>
        <Main></Main>
      </Container>
    </Wrapper>
  );
};

export default Following;
